import{_ as e,o as r,c as a,O as o}from"./chunks/framework.9482e208.js";const d=JSON.parse('{"title":"§ 13.1-924 Corporate name of foreign corporation.","description":"","frontmatter":{},"headers":[],"relativePath":"vacode/13.1-924.md","filePath":"vacode/13.1-924.md"}'),t={name:"vacode/13.1-924.md"},i=o('<h1 id="§-13-1-924-corporate-name-of-foreign-corporation" tabindex="-1">§ 13.1-924 Corporate name of foreign corporation. <a class="header-anchor" href="#§-13-1-924-corporate-name-of-foreign-corporation" aria-label="Permalink to &quot;§ 13.1-924 Corporate name of foreign corporation.&quot;">​</a></h1><p>A. No certificate of authority shall be issued to a foreign corporation unless the corporate name of such foreign corporation satisfies the requirements of § <a href="http://law.lis.virginia.gov/vacode/13.1-829/" target="_blank" rel="noreferrer">13.1-829</a>.</p><p>B. If the corporate name of a foreign corporation does not satisfy the requirements of § <a href="http://law.lis.virginia.gov/vacode/13.1-829/" target="_blank" rel="noreferrer">13.1-829</a>, to obtain or maintain a certificate of authority to transact business in the Commonwealth, if its real name is unavailable, the foreign corporation may use a designated name that is available, and that satisfies the requirements of § <a href="http://law.lis.virginia.gov/vacode/13.1-829/" target="_blank" rel="noreferrer">13.1-829</a>, if it informs the Commission of the designated name.</p><p>Code 1950, §§ 13.1-267, 13.1-268, 13.1-277; 1956, c. 428; 1975, c. 500; 1985, c. 522; 1986, cc. 232, 571; 2003, c. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?031+ful+CHAP0592" target="_blank" rel="noreferrer">592</a>; 2005, c. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?051+ful+CHAP0379" target="_blank" rel="noreferrer">379</a>; 2007, c. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?071+ful+CHAP0925" target="_blank" rel="noreferrer">925</a>; 2012, c. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?121+ful+CHAP0063" target="_blank" rel="noreferrer">63</a>.</p>',4),n=[i];function s(c,f,l,p,g,h){return r(),a("div",null,n)}const m=e(t,[["render",s]]);export{d as __pageData,m as default};
